  false,\n\t\"url\": null,\n\t\"notes\": \"This is one data set of a data package
  consisting of thirteen point data sets that have as attributes the direction and
  velocity of ocean currents in the 'eastern' Gulf of Mexico as determined by drift
  buoys from February 1996 to June 1997. The data are summarized by quarter degree
  cells and represent the time weighted average of drift direction and velocity for
  all drift buoys that entered the cell during the summary time period. Twelve of
  the data sets are one month averages, one data set is a one year average from all
  the months. The area covered is nominally the eastern Gulf of Mexico, but during
  the course of the study, the buoys drifted as far west as Texas. These spatial extent,
  object count and range attribute metadata items apply in particular to the one-year
  average data set, however the general characteristics of the dataset (coordinate
  system, attributes and attribute definitions) apply to all thirteen.\",\n\t\"license_title\":
